import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';

import Zomoto from './Zomoto';

function Router(){
    return(
        <BrowserRouter>
          
            <Route path='/Zomoto' Component={Zomoto}/>
        </BrowserRouter>
    );
}
